import "./App.css";

function App() {


  return (
    <div>
      <div class="header">
            <a class="logo" href="index.html"> </a>
            <div class="lnk">
                <a class="ig home" href="#home">Home</a>
                <a class="ig about" href="#nam">About Us</a>
                <a class="ig services" href="#service">Activities</a>
                <a class="ig contact" href="#contact">Transformations</a>
                <a class="ig teams" href="#tem">Our Team</a>
            </div>
        </div>
    </div>
  );
}

export default App;
